import Layout from '../components/Layout';
import Link from 'next/link';

const PostLink = (props) => {
    return (
        <li>
            <Link href={`/post?title=${props.title}`}>
                <a>{props.title}</a>
            </Link>
        </li>
    );
}

const Index = () => {
    return (
        <Layout>
            <h1>My Blog</h1>
            <ul>
               <PostLink title="Hello Next" />
               <PostLink title="初めてのNextアプリ" /> 
            </ul>
        </Layout>
    );
}

export default Index;
